-- 教练排班价格表
drop TABLE if EXISTS `t_coach_class_price`;
CREATE TABLE `t_coach_class_price` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `cityId` int(11) NOT NULL COMMENT '城市id',
  `courseId` varchar(50) NOT NULL COMMENT '课程id',
  `colId` int(11) NOT NULL COMMENT '定价的教练等级id',
  `calId` int(11) DEFAULT NULL COMMENT '定价的汽车等级id',
  `dftype` int(11) DEFAULT NULL COMMENT '汽车档位类型(1C1，2C2)',
  `tstart` varchar(20) NOT NULL COMMENT '定价开始时间，优先级从高到低分别有3种格式，分别是：YYYY-MM-dd-hh, MM-dd-hh和ww-hh',
  `tend` varchar(20) NOT NULL COMMENT '定价开始时间，同上有3种格式,并且每条记录必须保持和tstart为同一种格式'',',
  `maxNum` int(11) NOT NULL DEFAULT '1' COMMENT '人数',
  `duration` int(11) NOT NULL DEFAULT '1' COMMENT '小时数',
  `price` int(11) NOT NULL DEFAULT '0' COMMENT '总价格',
  `allowance` int(11) DEFAULT '0' COMMENT '与价格对应的补贴',
  `transCosts` int(11) DEFAULT '0' COMMENT '接送费用',
  `transType` tinyint(4) DEFAULT '1' COMMENT '接送类型：1-全包、2-半包、3-不包',
  `ctype` tinyint(4) DEFAULT '3' COMMENT '课时类型：1-现约，3-预约',
  `isdel` tinyint(4) DEFAULT '0' COMMENT '删除状态：0代表未删除，1代表已删除',
  `verify` tinyint(4) DEFAULT '1' COMMENT '审核状态:0代表未审核，1代表已审核',
  `cuid` varchar(32) DEFAULT NULL COMMENT '创建人',
  `ctime` datetime DEFAULT NULL COMMENT '创建时间',
  `muid` varchar(32) DEFAULT NULL COMMENT '修改人',
  `mtime` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '更新时间',
  `remark` varchar(254) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=313 DEFAULT CHARSET=utf8 COMMENT='教练排班价格表';



-- 教练排班价格表
drop TABLE if EXISTS `t_coach_class_temp`;
CREATE TABLE `t_coach_class_temp` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `tempId` int(11) NOT NULL COMMENT '模板ID',
  `tempName` varchar(254) DEFAULT NULL COMMENT '模板名称',
  `coachId` bigint(20) DEFAULT NULL COMMENT '教练ID',
  `cstart` datetime DEFAULT NULL COMMENT '开始时间',
  `cend` datetime DEFAULT NULL COMMENT '结束时间',
  `stime` varchar(20) DEFAULT NULL COMMENT '定价开始时间，优先级从高到低分别有3种格式，分别是：YYYY-MM-dd-hh, MM-dd-hh和ww-hh',
  `tend` varchar(20) DEFAULT NULL COMMENT '定价开始时间，同上有3种格式,并且每条记录必须保持和tstart为同一种格式',
  `duration` int(11) NOT NULL DEFAULT '1' COMMENT '课时',
  `courseId` varchar(50) DEFAULT NULL COMMENT '预约科目id',
  `courseName` varchar(254) DEFAULT NULL COMMENT '预约科目',
  `maxNum` tinyint(4) DEFAULT NULL COMMENT '人数',
  `fieldId` int(11) DEFAULT NULL COMMENT '训练场ID',
  `fieldName` varchar(64) DEFAULT NULL COMMENT '训练场名称',
  `ctime` datetime DEFAULT NULL COMMENT '创建时间',
  `coachCarId` int(11) DEFAULT NULL COMMENT '教练车ID',
  `drType` tinyint(4) DEFAULT NULL COMMENT '准驾车型(1C1，2C2)',
  `channel` tinyint(4) DEFAULT '1' COMMENT '来源：1-系统，2-手工',
  `isUse` tinyint(4) NOT NULL DEFAULT '0' COMMENT '是否使用：0-不启用，1-启用',
  `cityId` int(11) DEFAULT NULL COMMENT '教练注册所在的城市',
  `mtime` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '更新时间',
  `lae` double DEFAULT NULL COMMENT '训练场纬度',
  `lge` double DEFAULT NULL COMMENT '训练场经度',
  `schoolId` int(11) DEFAULT NULL COMMENT '驾校ID',
  `remark` varchar(254) DEFAULT NULL COMMENT '模板说明',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=134 DEFAULT CHARSET=utf8 COMMENT='教练排班价格表';



