-- 错误信息申诉业务表
drop table if EXISTS t_coach_error_appeal;
CREATE TABLE `t_coach_error_appeal` (
`id`  int(11) NOT NULL AUTO_INCREMENT COMMENT '个人信息错误申述主键' ,
`coachId`  bigint(11) NOT NULL COMMENT '教练ID' ,
`appealContent`  varchar(300) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '申请申诉附加信息' ,
`itemIds`  varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '选项ID 多选逗号隔开' ,
`ctime`  datetime NULL DEFAULT NULL COMMENT '创建时间' ,
`mtime`  timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间' ,
`checkStatus`  tinyint(4) NULL DEFAULT NULL COMMENT '审核状态' ,
PRIMARY KEY (`id`)
)
ENGINE=InnoDB
DEFAULT CHARACTER SET=utf8 COLLATE=utf8_general_ci
COMMENT='错误信息申诉业务表'
AUTO_INCREMENT=8
ROW_FORMAT=COMPACT
;

-- 错误申诉选项
drop table if EXISTS t_coach_error_appeal_item;
CREATE TABLE `t_coach_error_appeal_item` (
`id`  int(11) NOT NULL AUTO_INCREMENT COMMENT '主键id' ,
`itemName`  varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '申诉项名称' ,
`isDel`  tinyint(4) NULL DEFAULT 0 COMMENT '是否删除' ,
PRIMARY KEY (`id`)
)
ENGINE=InnoDB
DEFAULT CHARACTER SET=utf8mb4 COLLATE=utf8mb4_general_ci
COMMENT='错误申诉选项表' 
AUTO_INCREMENT=4
ROW_FORMAT=COMPACT
;

